import { Footer } from "./footer";

export const AllProducts = () => {
  return (
    <div className="product-container">
      <NavBar />
      <h2>ALL PRODUCTS</h2>
      <Container fluid>
        <Row>
          {productData.map((item) => {
            return (
              <Col xs={6} md={4} xl={3}>
                <div className="category-item">
                  <img src={item.image} alt="" className="img-fluid" />
                  <h3>{item.name}</h3>
                  <h4>{item.price}</h4>
                </div>
              </Col>
            );
          })}
        </Row>
      </Container>
      <Footer />
    </div>
  );
};

